  try {
    const reply = await getAsync(schoolName);
    console.log(reply);
  } catch (error) {
    console.error(`Error getting value for ${schoolName}: ${error}`);
  }
}

// Call the functions
displaySchoolValue('Holberton');
setNewSchool('HolbertonSanFrancisco', '100');
displaySchoolValue('HolbertonSanFrancisco');

process.on('SIGINT', () => {
  client.quit();
  process.exit();
});

